from keras.utils import to_categorical
import numpy as np
import pandas as pd

"""Keras is an open-source library that provides a Python interface for artificial neural networks. Keras acts as an interface for the TensorFlow library. 

**to_categorical** Converts a class vector (integers) to binary class matrix.
((tf.keras.utils.to_categorical))

Our strategy will be using 20% of the train data (12000 data rows) as a validation set to optimize the classifier, while keeping test data to finally evaluate the accuracy of the model on the data it has never seen.

If you set the validation_split argument in model.fit to e.g. 0.1, then the validation data used will be the last 10% of the data. If you set it to 0.25, it will be the last 25% of the data, etc. Note that the data isn't shuffled before extracting the validation split, so the validation is literally just the last x% of samples in the input you passed.

therefore, we explicitly shuffle and split the validation data, as validation_split would use last 20% of the data in that case.t into k consecutive folds (without shuffling by default).
"""

from sklearn.model_selection import train_test_split

"""Sklearn (or Scikit-learn). It is a Python library that offers various features for data processing that can be used for classification, clustering, and model selection.

Model_selection is a method for setting a blueprint to analyze data and then using it to measure new data.Selecting a proper model allows you to generate accurate results when making a prediction. It provides train/test indices to split data in train/test sets. Split dataset into k consecutive folds (without shuffling by default).

To do that, you need to train your model by using a specific dataset. Then, you test the model against another dataset.
The reason is that when the dataset is split into train and test sets, there will not be enough data in the training dataset for the model to learn an effective mapping of inputs to outputs. There will also not be enough data in the test set to effectively evaluate the model performance.

If you have one dataset, you'll need to split it by using the Sklearn train_test_split function first.
"""

data_train = pd.read_csv('fashion-mnist_train.csv')
data_test = pd.read_csv('fashion-mnist_test.csv')

"""input 2 different csv files, one for training the model, another for testing the model, the last 20% of the training data as a validator dataset to optimize the model

usual standard splits use 60,000 images for training the model and 10,000 for testing the model.
"""

img_rows, img_cols = 28, 28
input_shape = (img_rows, img_cols, 1)

"""all images are 28 x 28 and 784 pixels in total

input_shape sets the array or tensor with 3 dimensions, in this case a 2d array of 784 pixel values defining each picture of clothing


"""

X = np.array(data_train.iloc[:,1:])
y = to_categorical(np.array(data_train.iloc[:,0]))

"""X gets reshaped data
Y normalizes the grayscale data (that's between 0 - 255) and represents it as a binary rep 0 and 1

np.array creates an array from the data_train matrix,

integer location based indexing, iloc slices the dataset matrix, 

[first dimension slice , second dimension slice] for a 2d matrix

[:] == whole array

[start:] == from start to end

[:stop] == from beginning to stop-1

[start:stop] == from start to stop-1

[:,1:] == [all rows, from column 1 to end] since column 0 is class labels 
one whole row represents one clothing pic, all rows represent ALL clothes pics
[;,0] == [all rows, ONLY column 0] 
column 0 is class labels, labels are numbers from 0 - 9, to_categorical will convert these numbers into their corresponding binary matrices
eg 5 = [1,0,1] additionally,
each class label is converted to a 10 digit representative binary matrix where 6 are 0s and the 4 represents each class, each digit is a probability, so each probability vector generated at the penultimate layer is compared with each class label binary one_hot encoded vector

eg shirt == 0 0 0 0 0 0 0 1 0 1 
the prob vector obtained could be 0 0.1 0.1 0 0.1 0.4 0 0.9 0 0.9

hence it would be classified as a shirt, therefore the class labels are converted or one_hot encoded into vectors of digit probabilities 

(( all class labels are one_hot encoded using to_categorical() ))

"""

X_train, X_val, y_train, y_val = train_test_split(X, y, test_size=0.2, random_state=13)

"""splitting the training data 20% to get validator part of training dataset (using it to validate the performance of the classifier)

therefore, 48k for training, 12k for validation

X,y == dataset we've selected to use
X is the matrix of all clothes pictures
y is the binary normalized vector representing clothes class labels
test_size = 0.2 aka 20%
random_state = 13 , None for this returns randomized values each time but any number from 0 returns the same values each time

X_train, Y_train = matrix of training values

x_val, y_val = matrix of validator values

"""

X_test = np.array(data_test.iloc[:, 1:])
y_test = to_categorical(np.array(data_test.iloc[:, 0]))

"""partition test data similarly"""

X_train = X_train.reshape(X_train.shape[0], img_rows, img_cols, 1)
X_test = X_test.reshape(X_test.shape[0], img_rows, img_cols, 1)
X_val = X_val.reshape(X_val.shape[0], img_rows, img_cols, 1)

"""reshape the matrix into individual images

.shape[0] == no. of rows

X_train.reshape(60000,28,28,1)
makes sure that the images are split from one line rows into 2d matrices, while also keeping it as 60000 images

so now X_train contains 60000 images each represented as 2d matrices

same for test and val
"""

X_train = X_train.astype('float64') # changed from float32 due to loss nan error, originally float32
X_test = X_test.astype('float64')
X_val = X_val.astype('float64')
X_train /= 255
X_test /= 255
X_val /= 255

"""normalize picture matrix pixel values from grayscale, which are between 0 - 255, and represent them as 0 or 1, done by dividing by 255"""

import keras
from keras.models import Sequential
from keras.layers import Dense, Dropout, Flatten

"""# In Keras, this is a typical process for building a CNN architecture:

1. Reshape the input data into a format suitable for the convolutional layers, using X_train.reshape() and X_test.reshape()

2. For class-based classification, one-hot encode the categories using to_categorical()

3. Build the model using the Sequential.add() function.

4. Add a convolutional layer, for example using Sequential.add(Conv2D(…)) – see our in-depth guide to Keras Conv2D  layers.

5. Add a pooling layer, for example using the Sequential.add(MaxPooling2D(…)) function

6. Add a “flatten” layer which prepares a vector for the fully connected layers

7. Add one or more fully connected layer using Sequential.add(Dense)), and if necessary a dropout layer.

8. Compile the model using model.compile()

9. Train the model using model.fit(), supplying X_train(), X_test(), y_train() and y_test()

10. Use model.predict() to generate a prediction.

# Functions used

**sequential**
> There are two ways to build Keras models: sequential and functional.
The sequential API allows you to create models layer-by-layer for most problems. It is limited in that it does not allow you to create models that share layers or have multiple inputs or outputs.

**dense**
> A dense layer is just a regular layer of neurons in a neural network. Each neuron recieves input from all the neurons in the previous layer, thus densely connected. The layer has a weight matrix W, a bias vector b, and the activations of previous layer a
each input node is connected to each output node

**dropout**
>Dropout is a regularization technique, which aims to reduce the complexity of the model with the goal to prevent overfitting.

>Using “dropout", you randomly deactivate certain units (neurons) in a layer with a certain probability p from a Bernoulli distribution (typically 50%, but this yet another hyperparameter to be tuned).

> *Overfitting refers to a model that models the training data too well.
Overfitting happens when a model learns the detail and noise in the training data to the extent that it negatively impacts the performance of the model on new data. This means that the noise or random fluctuations in the training data is picked up and learned as concepts by the model. The problem is that these concepts do not apply to new data and negatively impact the models ability to generalize*

**flatten**
>The role of the Flatten layer in Keras is super simple: A flatten operation on a tensor reshapes the tensor to have the shape that is equal to the number of elements contained in tensor non including the batch dimension.
"""

from keras.layers import Conv2D, MaxPooling2D
from keras.layers.normalization import BatchNormalization

"""**Conv2D**
>tf.keras.layers.Conv2D(filters, kernel_size,activation,kernel_initializer,input_shape)


A convolution is the simple application of a filter to an input that results in an activation. Repeated application of the same filter to an input results in a map of activations called a feature map, indicating the locations and strength of a detected feature in an input, such as an image.
A multiplication is performed between an array of input data and a two-dimensional array of weights, called a filter or a kernel.
The filter is smaller than the input data and the type of multiplication applied between a filter-sized patch of the input and the filter is a dot product. A dot product is the element-wise multiplication between the filter-sized patch of the input and filter, which is then summed, always resulting in a single value. Because it results in a single value, the operation is often referred to as the “scalar product“.Using a filter smaller than the input is intentional as it allows the same filter (set of weights) to be multiplied by the input array multiple times at different points on the input. Specifically, the filter is applied systematically to each overlapping part or filter-sized patch of the input data, left to right, top to bottom.This systematic application of the same filter across an image is a powerful idea. If the filter is designed to detect a specific type of feature in the input, then the application of that filter systematically across the entire input image allows the filter an opportunity to discover that feature anywhere in the image. This capability is commonly referred to as translation invariance, e.g. the general interest in whether the feature is present rather than where it was present.

The output from multiplying the filter with the input array one time is a single value. As the filter is applied multiple times to the input array, the result is a two-dimensional array of output values that represent a filtering of the input. As such, the two-dimensional output array from this operation is called a “feature map“.

Once a feature map is created, we can pass each value in the feature map through a nonlinearity, such as a ReLU, much like we do for the outputs of a fully connected laye

1. filters: Integer, the dimensionality of the output space (i.e. the number of output filters in the convolution). 
the number of filter arrays that will be passed as convolutions to be multiplied with the input 2d matrix to produce output tensors/feature maps
multiple features are learned in parallel 

2. kernel_size: An integer or tuple/list of 2 integers, specifying the height and width of the 2D convolution window. Can be a single integer to specify the same value for all spatial dimensions

3. activation: Activation function to use. If you don't specify anything, no activation is applied

In a neural network, the activation function is responsible for transforming the summed weighted input from the node into the activation of the node or output for that input.

Activation function decides, whether a neuron should be activated or not by calculating weighted sum and further adding bias with it. The purpose of the activation function is to introduce non-linearity into the output of a neuron.

We know, neural network has neurons that work in correspondence of weight, bias and their respective activation function. In a neural network, we would update the weights and biases of the neurons on the basis of the error at the output. This process is known as back-propagation. Activation functions make the back-propagation possible since the gradients are supplied along with the error to update the weights and biases.

A neural network without an activation function is essentially just a linear regression model. The activation function does the non-linear transformation to the input making it capable to learn and perform more complex tasks.
>**ReLU** The rectified linear activation function or ReLU for short is a piecewise linear function that will output the input directly if it is positive, otherwise, it will output zero. It has become the default activation function for many types of neural networks because a model that uses it is easier to train and often achieves better performance.

>**Softmax** is a mathematical function that converts a vector of numbers into a vector of probabilities, where the probabilities of each value are proportional to the relative scale of each value in the vector.
The most common use of the softmax function in applied machine learning is in its use as an activation function in a neural network model. Specifically, the network is configured to output N values, one for each class in the classification task, and the softmax function is used to normalize the outputs, converting them from weighted sum values into probabilities that sum to one. Each value in the output of the softmax function is interpreted as the probability of membership for each class.


4. kernel_initializer: Initializer for the kernel weights matrix

The neural network needs to start with some weights and then iteratively update them to better values. The term kernel_initializer is a fancy term for which statistical distribution or function to use for initialising the weights. In case of statistical distribution, the library will generate numbers from that statistical distribution and use as starting weights.

**MaxPooling**

Pooling layers are used to reduce the dimensions of the feature maps. Thus, it reduces the number of parameters to learn and the amount of computation performed in the network.
The pooling layer summarises the features present in a region of the feature map generated by a convolution layer. So, further operations are performed on summarised features instead of precisely positioned features generated by the convolution layer. This makes the model more robust to variations in the position of the features in the input image.

Max pooling is a pooling operation that selects the maximum element from the region of the feature map covered by the filter. Thus, the output after max-pooling layer would be a feature map containing the most prominent features of the previous feature map.

**BatchNormalization**

Training deep neural networks with tens of layers is challenging as they can be sensitive to the initial random weights and configuration of the learning algorithm.

One possible reason for this difficulty is the distribution of the inputs to layers deep in the network may change after each mini-batch when the weights are updated.

the argument above means by consequence that the distribution of input data for some particular layer depends on all the interactions happening in all the upstream layers.
Secondly, this means by consequence that a change in how one or more of the upstream layer(s) process data will change the input distribution for this layer.

[[Initial weights are randomly generated and used, so they differ from batch to batch.]]

Batch normalization is a technique for training very deep neural networks that standardizes the inputs to a layer for each mini-batch. This has the effect of stabilizing the learning process and dramatically reducing the number of training epochs required to train deep networks.


"""

batch_size = 256
num_classes = 10
epochs = 50

"""The batch size is a hyperparameter that defines the number of samples to work through before updating the internal model parameters.

The number of epochs is a hyperparameter that defines the number times that the learning algorithm will work through the entire training dataset.

You can think of a for-loop over the number of epochs where each loop proceeds over the training dataset. Within this for-loop is another nested for-loop that iterates over each batch of samples, where one batch has the specified “batch size” number of samples

aka 50 times over  samples divided into 256 batches 
"""

img_rows, img_cols = 28, 28

model = Sequential()

"""# A Convolutional Neural Network (CNN) architecture has three main parts

A convolutional layer that extracts features from a source image. Convolution helps with blurring, sharpening, edge detection, noise reduction, or other operations that can help the machine to learn specific characteristics of an image.

A pooling layer that reduces the image dimensionality without losing important features or patterns.

A fully connected layer also known as the dense layer, in which **the results of the convolutional layers are fed through one or more neural layers to generate a prediction.**

Sequential aka layers are going to be stacked on each other to make the model
"""

model.add(Conv2D(32, kernel_size=(3, 3),
                 activation='relu',
                 kernel_initializer='he_normal',
                 input_shape=input_shape))
model.add(MaxPooling2D((2, 2)))

"""number of filters used = 32

convolution window's dimension = 9 pixels 2d window

activation used = rectified linear unit

initial values for weights in the filter used: he_normal = It draws samples from a truncated normal distribution centered on 0 with stddev = sqrt(2 / fan_in) where fan_in is the number of input units in the weight tensor.

input_shape = 784 pixel input picture


MaxPooling2D((2,2)) = after getting feature map collection from 32 filters, pass to maxpooling to get max value from every 2x2 portion of every one of the individual feature map matrices


"""

model.add(Dropout(0.25))
model.add(Conv2D(64, (3, 3), activation='relu'))
model.add(MaxPooling2D(pool_size=(2, 2)))

"""dropout with a probability 0.25 to avoid overfitting

convolutional layer 2 with **64 filters** this time, 9 pixel kernel, relu activation

maxpooling with 4 pixel picking as before



"""

model.add(Dropout(0.25))
model.add(Conv2D(128, (3, 3), activation='relu'))

"""another dropout with 0.25 probability 

convolutional layer 3 with **128 filters** this time, with 9 pixel kernel, and relu activation

no maxpooling used
"""

model.add(Dropout(0.4))
model.add(Flatten())

"""dropout with probability 0.4

**Calculating the dimensions of the feature maps obtained at each convolutional2d layer applied**

28 x 28 input vs 32 3 x 3 filters = 32 different matrices of 26 x 26 dimension 

26 x 26 input vs 64 3 x 3 filters = 64 different matrices of 24 x 24 dim 

24 x 24 input vs 128 3 x 3 filters = 128 different matrices of 22 x 22 dim.

**ABOVE ALL IN CASE OF NO MAXPOOLING USAGE**

>K * ( ( W - F + 2*P ) / S ) + 1

1 * ( ( 28 - 3 + 2.0 ) / 1 ) + 1 = 26

1 * ( ( 26 - 3 + 2.0 ) / 1 ) + 1 = 24

K = depth of conv layer

W = input volume size

F = kernel size 

S = stride value applied

P = amount of zero padding used on the border



flatten feature map matrices or 2d vector of features obtained from filtration, pooling and dropouts 
from 2d to one row vector rep as preparation for the next fully connected layer/ dense layer application


"""

model.add(Dense(128, activation='tanh')) # changed from relu due to loss nan error, originally relu
model.add(Dropout(0.3))
model.add(Dense(num_classes, activation='softmax'))

""">tf.keras.layers.Dense(units,activation=None)

units: size of output space one line vector always a positive integer yeah

activation: Activation function to use. If you don't specify anything, no activation is applied (ie. "linear" activation: a(x) = x).

Dense implements the operation: output = activation(dot(input, kernel) + bias) where activation is the element-wise activation function passed as the activation argument, kernel is a weights matrix created by the layer, and bias is a bias vector created by the layer (only applicable if use_bias is True).

*i guess the weights are randomized for this layer as with others after initial setting*


further dropout to prevent overfitting again with a probability of 0.3

using probability to class label for 10 classes (num_classes) using softmax activation in dense layer function

**Why are fully connected layers required?**

**We can divide the whole neural network (for classification) into two parts:**

**Feature extraction:** In the conventional classification algorithms, like SVMs, we used to extract features from the data to make the classification work. The convolutional layers are serving the same purpose of feature extraction. CNNs capture better representation of data and hence we don’t need to do feature engineering.

**Classification:** After feature extraction we need to classify the data into various classes, this can be done using a fully connected (FC) neural network. In place of fully connected layers, we can also use a conventional classifier like SVM. But we generally end up adding FC layers to make the model end-to-end trainable. The fully connected layers learn a (possibly non-linear) function between the high-level features given as an output from the convolutional layers.


---



The objective of a fully connected layer is to take the results of the convolution/pooling process and use them to classify the image into a label (in a simple classification example).

The output of convolution/pooling is flattened into a single vector of values, each representing a probability that a certain feature belongs to a label.


each flattened vector value must pass through each and every label to get the probablity of that feature captured belonging to THAT class aka getting the features for a shirt and then passing it through every label class for all clothes and getting the probability for shirts being the highest hence classifying it as a shirt!

also each flattened vector is actually a single sample (picture of a shirt for instance, after being passed over by so many filter kernel matrices for feature pooling and then max pooling THOSE feature maps)

so all this processing is happening in parallel
![The-Role-of-a-Fully-Connected-Layer-in-a-CNN-768x472.png](data:image/png;base64,)
"""

model.compile(loss=keras.losses.categorical_crossentropy,
              optimizer=keras.optimizers.Adam(),
              metrics=['accuracy'])

"""Once the model is created, you can config the model with losses and metrics with model.compile(), train the model with model.fit(), or use the model to do prediction with model.predict().

**compile method**
compile method configures the model for training

>Model.compile(optimizer,loss,metrics)

optimizer = An optimizer is one of the two arguments required for compiling a Keras model

*opt = keras.optimizers.Adam(learning_rate=0.01)*

(or)

*opt = keras.optimizers.Adam()*

and pass it to model.compile()

(or) use the string identifier for the optimizer directly in model.compile() wherein the default parameters for the optimizer will be used

*model.compile(loss='categorical_crossentropy',optimizer='adam')*

Adam optimization is a stochastic gradient descent method that is based on adaptive estimation of first-order and second-order moments.

[other available optimizers information](https://keras.io/api/optimizers/)

loss = The purpose of loss functions is to compute the quantity that a model should seek to minimize during training.
Neural networks are trained using stochastic gradient descent and require that you choose a loss function when designing and configuring your model.

can be passed after instantiating or as a string to model.compile() 

categorical_crossentropy computes the crossentropy loss between the labels and predictions.

Use this crossentropy loss function when there are two or more label classes. We expect labels to be provided in a one_hot representation. If you want to provide labels as integers, please use SparseCategoricalCrossentropy loss. There should be # classes floating point values per feature.

[other available losses information](https://://keras.io/api/losses)

metrics = list of metrics to be evaluated by the model during training and testing. Each of this can be a string (name of a built-in function), function or a tf.keras.metrics.Metric instance. See tf.keras.metrics. Typically you will use metric=['accuracy'].

A metric is a function that is used to judge the performance of your model.

Metric functions are similar to loss functions,** except that the results from evaluating a metric are not used when training the model.** Note that you may use any loss function as a metric. 

loss functions are used to identify what should be optimized in order to improve prediction but metrics are just used to measure or judge the performance of the predictor

accuracy calculates how often predictions equal labels.

This metric creates two local variables, total and count that are used to compute the frequency with which y_pred matches y_true. This frequency is ultimately returned as binary accuracy: an idempotent operation that simply divides total by count.

[other available metrics information](https://keras.io/api/metrics/)
"""

model.summary()

"""summary() function is a generic function used to produce result summaries of the results of various model fitting functions.

Here's what the typical end-to-end workflow looks like, consisting of:


1.   Training
2.   Validation on a holdout set generated from the original training data
3.   Evaluation on the test data

# Training the model
"""

history = model.fit(X_train, y_train,
          batch_size=batch_size,
          epochs=epochs,
          verbose=1,
          validation_data=(X_val, y_val))
score = model.evaluate(X_test, y_test, verbose=0)

"""We call fit(), which will train the model by slicing the data into "batches" of size "batch_size", and repeatedly iterating over the entire dataset for a given number of "epochs".

here, 256 batches and 50 epochs

fitting the model created onto the training dataset, then using the validation 20% of training dataset set aside initially for validation, and then testing the model on the testing dataset

**The returned "history" object holds a record of the loss values and metric values during training**

verbose = by setting verbose 0, 1 or 2 you just say how do you want to 'see' the training progress for each epoch.

verbose=0 will show you nothing (silent)

verbose=1 will show you an animated progress bar

verbose=2 will just mention the number of epoch

**evaluate** will use testing data to evaluate performance of the model and eturns the loss value & metrics values for the model in test mode as an object. Computation is done in batches, according to preset batch_size and epochs
 
"""

print('Test loss:', score[0])
print('Test accuracy:', score[1])
